import React from 'react';

class Card extends React.Component {
  constructor (props) {
    super(props);
    this.state = {card_num: 0};
  }

  render () {
    this.state = {card_num: ++this.state.card_num};
    return (
      <h3>Card number: {this.state.card_num}</h3>
    );
  }
}


export default Card;
